import React from 'react';
import SidebarMenu from './SidebarMenu';
import Button from './commons/Button';
import { CSSTransition, transit } from 'react-css-transition';

const styles = {
  defaultStyle: {
    transform: 'translate(0, 0)'
  },
  enterStyle: {
    transform: transit('translate(200px, 0)', 500, 'ease-in-out')
  },
  leaveStyle: {
    transform: transit('translate(0, 0)', 500, 'ease-in-out')
  },
  activeStyle: {
    transform: 'translate(00px, 0)'
  }
};
function Sidebar(props) {
  return (
    <CSSTransition {...styles} active={props.active}>
      <div className='sidebar'>
        <SidebarMenu />
        <Button onClick={props.onHandleSidebar} name='Arrow' />
      </div>
    </CSSTransition>
  );
}

export default Sidebar;
